def grid_to_world(grid_position):
    grid_resolution = 0.05000000074505806
    grid_origin = (-5.403664090051974, -5.397577919270642)
    world_x = grid_position[0] * grid_resolution + grid_origin[0]
    world_y = grid_position[1] * grid_resolution + grid_origin[1]
    return (world_x, world_y)

def world_to_grid(world_position):
    grid_resolution = 0.05000000074505806
    grid_origin = (-5.403664090051974, -5.397577919270642)
    grid_x = int((world_position[0] - grid_origin[0]) / grid_resolution)
    grid_y = int((world_position[1] - grid_origin[1]) / grid_resolution)
    return (grid_x, grid_y)

